import React, { useState } from 'react';
import  ContentList from './ContentList';
import ContentItem  from '../types/ContentList';

export default function Home() {
    const sampleContent: ContentItem[] = [
        { id: 1, title: "Sample Title 1", body: "This is a sample body for content 1.", status: "draft", tags: ["tag1", "tag2"], createdAt:"Now" },
        { id: 2, title: "Sample Title 2", body: "This is a sample body for content 2.", status: "published", tags: ["tag3"], createdAt: "Now" },
    ];

    const [content, setContent] = useState<ContentItem[]>(sampleContent);

    return (

      <div>
          <h1>Content List</h1>
          <ContentList content={content} />
      </div>
    );
}
